  },

  plugins: [
    new MiniCssExtractPlugin({
      filename: "styles.[contenthash:20].css",
      chunkFilename: "styles.[contenthash:20].css",
      allChunks: true
    }),
    new OptimizeCSSAssetsPlugin({}),
    new ManifestPlugin({
      publicPath: "/build/"
    })
  ]
});

